    test(solution.addSpaces("LeetcodeHelpsMeLearn", [8,13,15]), "Leetcode Helps Me Learn")
    test(solution.addSpaces("icodeinpython", [1,5,7,9]), "i code in py thon")
    test(solution.addSpaces("spacing", [0,1,2,3,4,5,6]), " s p a c i n g")
